searchScript.scriptText:
import org.eclipselabs.real.core.searchobject.script.SOContainer;
import org.eclipselabs.real.core.searchobject.script.SRContainer;

SOContainer addAgentSO = SearchScriptResult.getByName("Add Agent");
SRContainer addAgentSR = addAgentSO.execute();
for(int i = 0; i < addAgentSR.getResultsCount(); i++) {
	addAgentSR.updateReplaceMap(i,"AGENT_ID");
	SOContainer addContactTypesSO = SearchScriptResult.getByName("Add ContactTypes");
	SRContainer addContactTypesSR = addContactTypesSO.execute();
	if (!addContactTypesSR.isEmpty()) {
		addAgentSR.appendText(i, addContactTypesSR.getText(0));
		addAgentSR.addView(i,"Contact Types",addContactTypesSR.getView(0,"CONTACT_TYPES"));
		addAgentSR.pushResultObject(i, "Time", "phoneSetLoginId","sipVoiceUri","Contact Types","Agent ID");
	}
}
SearchScriptResult.setViewOrder("Time","phoneSetLoginId","sipVoiceUri","Contact Types","Agent ID");

import org.eclipselabs.real.core.searchobject.script.SOContainer;
import org.eclipselabs.real.core.searchobject.script.SRContainer;

SOContainer bbuaMainContactSO = SearchScriptResult.getByName("Main BbuaContact Create");
SRContainer bbuaMainContactSR = bbuaMainContactSO.execute();
for(int i = 0; i < bbuaMainContactSR.getResultsCount(); i++) {
	bbuaMainContactSR.updateReplaceMap(i,"BBUA_MAIN_CONTACT_ID");
	bbuaMainContactSR.pushResultObject(i, "Time","Bbua Contact ID");
	SOContainer bbuaMainContactConnsSO = SearchScriptResult.getByName("Main BBUA contact connections");
	SRContainer bbuaMainContactConnsSR = bbuaMainContactConnsSO.execute();
	bbuaMainContactConnsSR.pushResultObjects("Time","Bbua Contact ID","BBUA Connection ID","BBUA Address","Change","Reason Code");
}
SearchScriptResult.setViewOrder("Time","Bbua Contact ID","BBUA Connection ID","BBUA Address","Change","Reason Code");

